import React from 'react';
import { Carousel, Button } from 'react-bootstrap';


const MainBanner = () => {
  return (
    <Carousel>
      {/* Example for one carousel item, repeat for more items */}
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="image_url_here.jpg" // Replace with your image URL
          alt="First slide"
        />
        <Carousel.Caption>
          <h3>First slide label</h3>
          <p>Description for the first slide.</p>
          <Button variant="primary">Sign up</Button>{' '}
          <Button variant="secondary">Take a Tour</Button>
        </Carousel.Caption>
      </Carousel.Item>

      {/* Repeat the <Carousel.Item>...</Carousel.Item> block for more images */}
      
    </Carousel>
  );
};

export default MainBanner;
